import styled from "styled-components";
import { colors } from "../../Styles";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import routes from '../../Routes';

interface Props {}

export default function BottomNavBar(props: Props) {
  return (
    <BottomNavBarContainer>
      <Link to={routes}>
        <BottomNavBarItem style={{ color: colors.MidBlue }}>
          써클
        </BottomNavBarItem>
      </Link>

      <BottomNavBarItem>친구들</BottomNavBarItem>
      <BottomNavBarItem>마이페이지</BottomNavBarItem>
    </BottomNavBarContainer>
  );
}

const BottomNavBarContainer = styled.div`
  height: 75px;
  display: flex;
  justify-content: center;
  align-items: center;
  position: fixed;
  left: 50;
  bottom: 0;
  background-color: white;
  filter: drop-shadow(16px 16px 20px rgba(75, 88, 208, 0.15));
`;

const BottomNavBarItem = styled.div`
  width: 125px;
  height: 75px;
  display: flex;
  justify-content: center;
  align-items: center;
  &:hover {
    opacity: 0.5;
    cursor: pointer;
  }
`;
